import React from 'react';
import button from '@material-ui/core/button';

function NextPrev(props){
    return(
        <nav className='reusebar' style={{position: "absolute", left:"363px",bottom: '-110px'}}>
        <div >
            <button className='btn btn-outline-danger' onClick={props.prev} disabled={props.dis}>prev</button>
            <emsp/>
            <button className='btn btn-outline-primary' onClick={props.next} disabled={props.limit}>next</button>
        </div>
        </nav>
    )
}

export default NextPrev;
